package dec2022;

public class Page5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x=1;
		int y=0;
		System.out.println(x);
		System.out.println(y);
		System.out.println(x++);
		System.out.println(++y);
		System.out.println(x);
		System.out.println(y);
		if(x++ > ++y)
		{
			System.out.println("Hello ");
		}else 
		{
			System.out.println("Welcome ");
		}
		System.out.println(x+y);
	}

}
